Result = true;
Message = "ok";

if(RF.RequestForm.CreatedFromRF_Id == null)
{
	Message = "no parent rf";
	return 0M;	
}

var parentRFnode = OtherRfs.Where(x => x.RequestForm_Id == RF.RequestForm.CreatedFromRF_Id).FirstOrDefault();

var noderepo = IocManager.Instance.Resolve<IRepository<GeoWorks.Entities.TreeNode , System.Int32>>();

var parentChildren = noderepo.GetAll().Where(x => x.RfId == parentRFnode.RequestForm_Id).ToList();

var setup = parentChildren.Where(x => x.NodeType == EnNodeTreeType.TrunkSetup).FirstOrDefault();


if(setup == null || setup.TrunkSetup == null || setup.TrunkSetup.TrunkSetupDetails.Count == 0 || !setup.TrunkSetup.TrunkSetupDetails.Any(y => y.Setup.TypeOfSetup_Id == 2 || y.Setup.TypeOfSetup_Id == 3))
{
    Message = "no parent rf";
	return 0M;	
} 

var cantieriSum = setup.TrunkSetup.TrunkSetupDetails.Where(y => y.Setup.TypeOfSetup_Id == 2).Sum(y => y.Surface);


if(cantieriSum < 1M)
{
    cantieriSum = 1M;
}
else 
{
    cantieriSum = Math.Ceiling(cantieriSum * 2M) / 2M;
}

var depositoSum = setup.TrunkSetup.TrunkSetupDetails.Where(y => y.Setup.TypeOfSetup_Id == 3).Sum(y => y.Surface); 

if(depositoSum < 1M)
{
    depositoSum = 1M;
}
else 
{
    depositoSum = Math.Ceiling(depositoSum * 2M) / 2M;
}


var daysMora = (DateTime.Now - parentRFnode.ExpectedEnd.Value.Date).Days;

if(daysMora < 1)
{
	Message = "no mora";	
	return 0M;
}

var res = 1.5M * 0.3M * daysMora * (depositoSum + cantieriSum);
CurrentPayment.Instalment.TotalDue = res;
return res;

